import { Button, Container, Typography } from '@mui/material';
import React from 'react';
function Home() {
  return (
    <>
      <Container>
        <Typography sx={{m}}>To Create Note Press the Button</Typography>

      <Button variant='contained'>Create A Note</Button>
      </Container>
    </>
  );
}

export default Home;
